import React from "react";
import Header from "../../components/comman/Header";
import QuickInfo from "../../components/compounder/QuickInfo";
import Registration from "../../components/compounder/Registration";
import RegistrationForm from "../../components/compounder/NewRegistrationForm";
import WaitingQueue from "../../components/compounder/WaitingQueue";

const Deshboard_CP = () => {
  return (
    <div>
        <Header></Header>
        <main className="w-full p-2  gap-2">
            <div className=" w-full ">
                <Registration></Registration>
            </div>
            <div className=" w-1/2 ">
                <WaitingQueue></WaitingQueue>
            </div>


        </main>


     <div className='h-[2000px] bg-red-400 w-full border border-blue-600'></div>
    </div>
  )
}

export default Deshboard_CP;
